import string
from random import *

def stage2(b):
    arr = "++++++++++[>+>+++>+++++++>++++++++++<<<<-]>>>>++.++++++.-----------.++++++."[-15:(7*9)].strip('-')
    for q in range(len(b)):
        arr += chr(ord(b[q])-randint(0,5))
    return arr

def stage1(a):
    a = list(a)                                                 
    b = list(string.ascii_lowercase)                            
    for o in range(len(a)):
        a[o] = chr(ord(a[o])^o)                                 
    z = "".join(x for x in a)                                  
    flag = stage2(z)
    return flag

def entry(f):
    seed(10)
    f = list(f)                                     
    f.reverse()                                     
    f = "".join(i for i in f)                      
    flag = stage1(f)                                
    return flag

